import React from 'react';
import styled from 'styled-components';
import Paragraf from './ParagrafMain.js';

import '../../Nav/GlobalNav.js';
import Lock from '../../../img/block.svg';


const Container = styled.div`
    width: 1903px;
    height: 400px;
    position: relative;
    top: 400px;

`
const InContainer = styled.div`
    width: 1040px;
    height: 400px;
    margin: 0 432px;
    padding: 0 20px;
    display: flex;



`

const Box = styled.div`
 position: relative;

`

const Item = styled.div`
    width: 500px;
    display: flex;

    p{
        font-size: 15px;
        font-weight: 300;
        margin: 0;
        border: none;
    }

`


class About2 extends React.Component {
  render(){
    return (
        <Container>
            <InContainer>
                <Box className="box">

                <Item ><img src={Lock} alt="lock"/><Paragraf className="introText" text="All card numbers are encrypted on disk with AES-256. Decryption keys are stored on separate machines.
                "/></Item>

                <Item ><img src={Lock} alt="lock"/><Paragraf className="introText" text="Stripe’s infrastructure for storing, decrypting, and transmitting card numbers runs in separate hosting infrastructure, and doesn’t share any credentials with Stripe’s primary services."/></Item>
                </Box>
            </InContainer>
        </Container>
    );
  }
}
export default About2;
